import { Link } from "react-router-dom";

const AdminHome = () => {
  return (
    <nav className="bg-gray-800 p-4">
      <ul className="flex justify-center space-x-8">
        <li className="hover:scale-105 transition-transform duration-300">
          <Link to="/course" className="text-white hover:text-gray-300">
            Courses
          </Link>
        </li>
        <li className="hover:scale-105 transition-transform duration-300">
          <Link to="/admin/roadmap" className="text-white hover:text-gray-300">
            Roadmap
          </Link>
        </li>
        <li className="hover:scale-105 transition-transform duration-300">
          <Link to="/test-notes" className="text-white hover:text-gray-300">
            Test Notes
          </Link>
        </li>
      </ul>
    </nav>
  );
};

export default AdminHome;
